import React from 'react';
import axios from 'axios';

import './item-container.styles.scss'

class ItemContainer extends React.Component {

    componentDidMount(){
        axios({
            url: 'items',
            method: 'GET'
        }).then(response => {
            items = response.data;
        }).catch(error => {
            console.log(error)
        })
    }

    render(){
        return (
            <div className="container">
                <div className="row">
                    {
                        items.map(item => {
                            console.log(item);
                        })
                    }
                </div>
            </div>
        )
    }
}

export default ItemContainer;
